import React, { useState } from 'react'
import { LOGO_URL } from './urlhub'
import { Link } from 'react-router';
import { useSelector } from 'react-redux';


const Header = () => {
  const[logbtn,setbtn]=useState("Login");


  const cartitems=useSelector((store)=> store.cart.items)

  return (
    <div className='flex justify-between shadow-lg '>
      <div className='w-24'>
        <img className='logo' src={LOGO_URL} alt='logo'/>
      </div>
      <div className='flex items-center'>
        <ul className='flex p-4 m-4 items-center'>
            <li className='px-4 font-bold'><Link to="/">Home</Link></li>
            <li className='px-4 font-bold'><Link to="/About">About</Link></li>
            <li className='px-4 font-bold'><Link to="/Cart"><img className='w-7 h-6' src='grocery-store.png'/></Link></li>
            <button
            className='logbtn font-bold'
            onClick={()=>{
              logbtn==="Login"
              ?setbtn("Logout")
              :setbtn("Login");
            }
            }
            >{logbtn}</button>
        </ul>
      </div>
    </div>
  )
}

export default Header
